import React from 'react';
import { BrowserRouter as Router, Route, Switch, Link } from 'react-router-dom';
import 'bootstrap/dist/css/bootstrap.min.css';
import './App.css';
import Welcome from './Welcome';
import DisplayQuestions from './DisplayQuestions';  // Assuming you have this component

function App() {
  return (
    <Router>
      <div className="App">
        <nav>
          <ul>
            <li>
              <Link to="/">Home</Link>  // Home page link
            </li>
            <li>
              <Link to="/questions">Display Questions</Link>  // Link to DisplayQuestions
            </li>
          </ul>
        </nav>
        <Switch>
          <Route path="/" exact component={Welcome} />
          <Route path="/questions" component={DisplayQuestions} />
        </Switch>
      </div>
    </Router>
  );
}

export default App;
